6	Seminar Nasional Pendidikan 2023	2023-08-24 13:45:18	<p>\tTantangan Pendidikan Abad 21 dalam Meningkatkan Kualitas Pendidik dan Generasi Muda di Era Digital Indonesia adalah negara yang mengedepankan pendidikan, karena pendidikan adalah kunci utama Indonesia mampu bersaing dalam kancah Internasional. </p><p><br></p><p>\tDalam dunia pendidikan, salah satu faktor penting yang perlu diperhatikan adalah kualitas guru di Indonesia, karena guru merupakan kunci penggerak utama dalam dunia pendidikan, pendidikan tanpa seorang guru tidaklah ada harganya. Namun realitanya di Indonesia kualitas guru masih sangat rendah, misalnya kurangnya pengetahuan tentang teknologi khususnya pada guru-guru yang senior, kurangnya kesadaran guru zaman sekarang mengenai tugas dan kewajiban guru, selain itu juga dikarenakan kreativitas yang terbatas, hal ini meyebabkan pendidikan di Indonesia tertinggal. </p><p><br></p><p>\tPeningkatan mutu pendidikan di Indonesia harus digencarkan melalui kegiatan-kegiatan yang dapat membangun motivasi dan kesadaran guru di Indonesia untuk mengatasi masalah hambatan yang ada di Indonesia. Oleh karena itu, sehubungan hal tersebut, HIMA PGSD FIP UNNES 2019 mengadakan kegiatan Seminar Nasional Pendidikan dengan mengusung tema Tantangan Pendidikan Abad 21 Dalam Meningkatkan Kualitas Pendidik dan Generasi Muda di Era Digital. </p><p><br></p><p>\tPembelajaran Abad 21 memiliki prinsip pokok bahwa pembelajaran harus berpusat pada siswa yang bersifat kolaboratif, kontekstual dan berintegrasi dengan masyarakat. Dalam melaksanakan pembelajaran, Guru memiliki peran penting dalam mewujudkan masa depan anak bangsa yang lebih baik. Kaitanya dengan pendidikan di Indonesia utamanya yaitu Perguruan Tinggi merupakan lembaga formal yang diharapkan dapat melahirkan tenaga pendidik yang mumpuni dalam mendidik peserta didik di era digital ini. </p><p><br></p><p>\tSelain itu, tantangan berikutnya adalah rekonstruksi kurikulum pendidikan tinggi yang responsif terhadap era digital juga diperlukan, seperti desain ulang kurikulum dengan pendekatan human digital dan keahlian berbasis digital. Dalam hal ini sehingga diharapkan dapat meningkatkan motivasi dan kreativitas guru meningkatkan pendidikan di Indonesia. </p><p><br></p><p>\tDalam Seminar Nasional Pendidikan kali ini, kita mengangkat tema  Tantangan Pendidikan Abad 21 dalam Meningkatkan Kualitas Pendidik dan Generasi Muda di Era Digital yang akan membahas tentang Pendidikan Karakter, Inovasi dan media pembelajaran, Teknologi Informasi dan Komunikasi dan Pendidikan Literasi. </p><p><br></p><p>\tSeminar nasional pendidikan 2019 mengundang pembicara yang berkompeten dibidangnya, antara lain Prof. Dr. Totok Sumaryanto F, M. Pd (Pakar Penelitian dan Evaluasi Pendidikan yang akan membahas mengenai Tantangan Pendidikan Abad 21), Bapak Falidan Ahmad, M. Pd (Widyaiswara PPPPTK PKn IPS Kemdikbud membahas tentang Kualitas Pendidik dan Generasi Muda), dan Ibu Yunina Resmi Prananta, M. Pd (Master of Teacher Ruang Guru Excellent Teacher, Writer, Trainer Entrepreneur Melu Nyong Tour yang akan membahas tentang Tantangan Pendidik dan Generasi Muda di Era Digital).</p>	https://www.primagamasiap.com/tryoutsnbt.php	1	content-card1.png
