--
-- Name: v_activity; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_activity AS
 SELECT subject.subject_id,
    exam_student.student_id,
    exam.teacher_id,
    exam_student.exam_submit AS tgl_submit,
    'Ujian'::text AS type
   FROM ((public.exam_student
     JOIN public.exam USING (exam_id))
     JOIN public.subject ON ((exam.subject_id = subject.subject_id)))
UNION
 SELECT subject.subject_id,
    task_student.student_id,
    task.teacher_id,
    task_student.task_submit AS tgl_submit,
    'Tugas'::text AS type
   FROM ((public.task_student
     JOIN public.task USING (task_id))
     JOIN public.subject ON ((task.subject_id = subject.subject_id)));


ALTER TABLE public.v_activity OWNER TO postgres;

--
-- Name: v_soal_category; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_soal_category AS
 SELECT DISTINCT s.subject_id,
    s.category,
    m.materi_id,
    ms.available_status
   FROM ((public.soal s
     JOIN public.materi m ON ((s.materi_id = m.materi_id)))
     JOIN public.materi_sekolah ms ON ((ms.materi_id = m.materi_id)));


ALTER TABLE public.v_soal_category OWNER TO postgres;

